const firstVariant = (arrayOfObjects, key) => {
  const firstObject = arrayOfObjects.reduce((prevVal, currVal) =>
    prevVal[key] > currVal[key] ? currVal : prevVal
  );

  return firstObject
};

export default firstVariant
